==Loot==
At current [[Grand Exchange]] prices, opening a magpie impling jar gives {{Coins|{{ImpValue|magpie|jar=yes}} round 0}} worth of loot, on average. This means opening magpie impling jars marks an average profit of {{Coins|{{ImpValue|magpie|jar=yes}}-{{GEP|Magpie impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|50*({{ImpValue|magpie|jar=yes}}-{{GEP|Magpie impling jar}}) round 0}} to get a [[clue scroll (hard)|hard clue scroll]] from magpie impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

